import React from 'react';
import firebase from '../firebase';
import AppRouter from './AppRouter';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  console.log('firebase : ', firebase);
  return (
  <>
    <AppRouter isLoggedIn={isLoggedIn} />
  </>
  )
}

export default App;
